  <Fragment>
    <br />
    <Draggable>
      <Card>
        <CardBody>
          <p>
            Directed Situations are short situations or scenarios in which you
            are required to give a one sentence response in Spanish.
          </p>
          <p>Lorem ipsum dolor sit amet.</p>
